import styled from "styled-components";

export const StyledButton = styled.button`
  min-width: 100px;
  height: 40px;
  letter-spacing: 0.5px;
  line-height: 35px;
  padding: 0 15px 0 15px;
  font-size: 20px;
  background-color: #545454;
  color: white;
  font-weight: bolder;
  border: 1px solid;
  cursor: pointer;
  display: flex;
  justify-content: center;
  border-radius: 10px;
`;
